// --- Function to copy the array(s) into the provided string buffer.
// --- Buffer size is not checked, as MakeCARR makes sure it's sufficient.
// ---------------------------------------------------------------------
void ReadJMSBIData(char *Buffer)
{
    memcpy(Buffer, &JMSBIL0[1], JMSBIL0[0] << 2);
    Buffer += (JMSBIL0[0] << 2);

    memcpy(Buffer, &JMSBIL1[1], JMSBIL1[0] << 2);
    Buffer += (JMSBIL1[0] << 2);

    memcpy(Buffer, &JMSBIL2[1], JMSBIL2[0] << 2);
    Buffer += (JMSBIL2[0] << 2);

    memcpy(Buffer, &JMSBIL3[1], JMSBIL3[0] << 2);
    Buffer += (JMSBIL3[0] << 2);

    memcpy(Buffer, &JMSBIL4[1], JMSBIL4[0] << 2);
    Buffer += (JMSBIL4[0] << 2);

    memcpy(Buffer, &JMSBIL5[1], JMSBIL5[0] << 2);
    Buffer += (JMSBIL5[0] << 2);

    memcpy(Buffer, &JMSBIB[1], JMSBIB[0]);
}

// --- Saved full qualified output path and filename, so we've no troubles
// --- when cleaning up, even if the current working folder was changed
// --- during program runtime.
// ---------------------------------------------------------------------
char JMSBIName[8192]; // it's a safe size for any current OS

// --- Cleanup function to delete the written file, called by the atexit()
// --- handler at program termination time, if requested by user.
// ---------------------------------------------------------------------
void KillJMSBIData(void)
{
    remove(JMSBIName);
}

// --- Function to write the array(s) back into a file, will return the
// --- full qualified output path and filename on success, otherwise an
// --- empty string is returned (access/write errors, file truncated).
// ---------------------------------------------------------------------
const char *WriteJMSBIData(const char *FileName, int16_t AutoClean)
{
    FILE   *han = NULL; // file handle
    int32_t num = NULL; // written elements

    #ifdef QB64_WINDOWS
    if (!_fullpath(JMSBIName, FileName, 8192)) return "";
    #else
    if (!realpath(FileName, JMSBIName)) return "";
    #endif

    if (!(han = fopen(JMSBIName, "wb"))) return "";
    if (AutoClean) atexit(KillJMSBIData);

    num = fwrite(&JMSBIL0[1], 4, JMSBIL0[0], han);
    if (num != JMSBIL0[0]) {fclose(han); return "";}

    num = fwrite(&JMSBIL1[1], 4, JMSBIL1[0], han);
    if (num != JMSBIL1[0]) {fclose(han); return "";}

    num = fwrite(&JMSBIL2[1], 4, JMSBIL2[0], han);
    if (num != JMSBIL2[0]) {fclose(han); return "";}

    num = fwrite(&JMSBIL3[1], 4, JMSBIL3[0], han);
    if (num != JMSBIL3[0]) {fclose(han); return "";}

    num = fwrite(&JMSBIL4[1], 4, JMSBIL4[0], han);
    if (num != JMSBIL4[0]) {fclose(han); return "";}

    num = fwrite(&JMSBIL5[1], 4, JMSBIL5[0], han);
    if (num != JMSBIL5[0]) {fclose(han); return "";}

    num = fwrite(&JMSBIB[1], 1, JMSBIB[0], han);
    if (num != JMSBIB[0]) {fclose(han); return "";}

    fclose(han);
    return JMSBIName;
}

